      | 4333 -> { ItemTypeData.id= 4333; name= "Research Abstract: Project Slipstream"; published= true; description= "<b>Paper:</b> Project Slipstream - Wormhole Physics for Capsuleers<br>  <b>Lead Researcher:</b> Helen Ohmiras<br>  <b>Contributors:</b> Rhavas, Pat Irvam<br>  <b>Summary:</b> Artificial wormhole induction processes are used in warp drives and jump drives across New Eden. Despite the prevalence of this technology, natural wormholes are still a mystery to many. A pilot with a firm grasp of wormhole mechanics can make more effective decisions when unforeseen and unpredicted events occur in the future.    Project Slipstream is an attempt to educate the wider capsuleer community on basic wormhole physics. We will focus on clearing up misconceptions regarding the difference between natural wormholes and artificial wormholes. The nature of wormholes present in the uncharted regions will also be determined. These findings will then be used as a starting point for further clarification of the physics behind the technology used to create artificial wormholes, as well as other wormhole induction drive technologies.    <i>This abstract relates to research undertaken by the <a href=evebrowser: http://wiki.eveonline.com/en/wiki/Arek%27Jaalan>Arek'Jaalan Project.</a></i>    <i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>    <i>Further copies of this document can be obtained through the Arek'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>"; marketGroupId= None; groupId= 1141; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
